import React, { Component } from "react";
import "../assets/stylesheets/main.scss";

export default class TemplateDefault extends Component {

	constructor(props) {
		super(props);
	}

	render(){
		return (
			<div>

				<div Class="body_content">
					<header Class="header_mobile">
		        <div aria-label="Show/hide menu" Class="header_mobile__mobile_menu_btn"></div>

		        <div Class="header_mobile__logo">
		          <a href="#" title="Go to HAR Styleguide homepage"><img src="assets/logo-har-default.svg" alt="HAR Styleguide" /></a>
		        </div>
		      </header>
				</div>




				{this.props.children}
			</div>
		)
	}
}
